@Override
public void appendEscapedEntityName(StringBuilder sb, String name) {
    sb.append('`');
    int dotPos = name.indexOf('.');
    if (dotPos > 0) {
        sb.append(name.substring(0, dotPos));
        sb.append("`.`");
        sb.append(name.substring(1 + dotPos));
    } else {
        sb.append(name);
    }
    sb.append('`');
}

